import React from "react";
import { useNavigate } from "react-router-dom";

let Nav = () => {
    let home = useNavigate();
    let service
    return (
        <>
            <nav>
                <div className="left-nav">
                    <h1>Jeni Soni</h1>
                </div>
                <div className="right-nav">
                    <ul>
                        <li>Home</li>
                        <li>Services</li>
                        <li>About</li>
                        <li>Contact</li>
                    </ul>
                </div>
            </nav>
        </>
    )
}

export default Nav;
